import React from 'react';
import {Paper, Box} from '@material-ui/core'
import './Home.css';

function Home(){
    return(
        <>
           <Paper>
            <Box>
                <Box>
                    <h1>Titulo</h1>
                </Box>
                
            </Box>
           </Paper>
        </>
    );
}

export default Home;
